import React from 'react'
import V from './main'

function NameList() {

  const users = [{
  name: 'Danil',
  age: 18,
  id: 1  
  } ,
  {
  name: 'Nurik',
  age: 18,
  id: 2 
  } 
]
 
const nameList = users.map(user => <C key={user.id}>{user.name}</C>)

  return (
    <div>
   {nameList}
    </div>
  )
}

export default NameList
